import React, { Component } from "react";

class LatestArticle extends Component {
  state = {};
  render() {
    return (
      <div>
        <div
          style={{
            height: 20,
            width: 20,
            backgroundColor: "black",
            position: "relative",
            bottom: -200,
            right: -120,
          }}
        >
          <span style={{ position: "relative", right: -30 }}>Featured</span>
        </div>
      </div>
    );
  }
}

export default LatestArticle;
